export function processDictionaryDirective(fieldMap, field) {
    field.resolve = function dictionaryDirectiveHandler(root) {
        const result = [];
        for (const key in root) {
            if (key in fieldMap) {
                continue;
            }
            result.push({
                key,
                value: root[key],
            });
        }
        return result;
    };
}
